import Img__VanshikhaKapoor from "../assets/people/vanshika-kapoor.jpg";
import Img__HarshaGupta from "../assets/people/harsha-gupta.jpg";
import Img__KashikaJain from "../assets/people/kashika-jain.jpg";
import Img__AasthaAggarwal from "../assets/people/aastha-agarwal.jpg";
import Img__RakshaGupta from "../assets/people/raksha-gupta.jpg";
import Img__Aarohsi from "../assets/people/aarushi.jpg";

/*
 * this is not a react component
 */

const TestimonialContent = () => [
  {
    img: Img__VanshikhaKapoor,
    name: "Vanshika Kapoor",
    summary: `GCI is a great platform to learn, it has helped me to start from
              the basics and has always pushed me to learn more. Without it I
              couldn't have made a move to learn code. Thankyou GCI for being
              such a great support`,
  },
  {
    img: Img__HarshaGupta,
    name: "Harsha Gupta",
    summary: `It was a very good experience learning with GCI. No matter what
              time it is, they're always available to help at any step. The
              milestones were very efficient and gave me a clear understanding
              of the topics. I'm glad to be a part of GCI.`,
  },
  {
    img: Img__Aarohsi,
    name: "Aarushi",
    summary: `Milestones are good and precise...on the topic...good medium to 
              learn`,
  },
  {
    img: Img__KashikaJain,
    name: "Kashika Jain",
    summary: `The experience of being associated with Girl Code It since past 
              few months has been a wonderful one. The various resources
              regarding scholarship and events to participate in have proven
              to be successful team efforts of our mentors.`,
  },
  {
    img: Img__AasthaAggarwal,
    name: "Aastha Aggarwal",
    summary: `The mentors are amazing & they help open heartedly so I am now
              able to think myself for alternative solution of a problem with
              the help of their guidance. Moreover, the quantity and quality
              of questions are superb.`,
  },
  {
    img: Img__RakshaGupta,
    name: "Raksha Gupta",
    summary: `As gci is very active, there's always a push to do things. The
              best thing about this community is that, here, I always feel
              like I have to do this.`,
  },
];

export default TestimonialContent();
